import React from 'react';
import logo from './logo.png'
import './App.css';

function App() {
    return (
        <div className="App">
            <header>
                <img src={logo}/>
            </header>

            <nav>
                <div>Profile</div>
                <div>Messages</div>
            </nav>
            <div>Main content</div>
        </div>
    );
}

export default App;
